export default {
  name: 'PTag',
  props: {
    attached: Boolean,
    closable: Boolean,
    type: String,
    size: String,
    rounded: Boolean,
    disabled: Boolean,
    ellipsis: Boolean,
    tabstop: {
      type: Boolean,
      default: true,
    },
  },
  computed: {
    classes() {
      return [
        'p-tag',
        this.size ? `p-tag---${this.size}` : '',
        this.type ? `p-tag---${this.type}` : '',
        this.rounded ? 'is-rounded' : '',
      ]
    },
  },
  methods: {
    /**
     * Emit close event when delete button is clicked
     * or delete key is pressed.
     */
    close() {
      if (this.disabled) {
        return
      }

      this.$emit('close')
    },
  },
}
